import styled from "@emotion/styled";

export const Card = styled.div` width: 300px;
  margin-top: 50px;
  margin-left: auto;
  margin-right: auto;
  padding: 10px 0 0 0;
  border-radius: 5px;
  text-align: center;
  border: 1px solid #000000;
  box-shadow: 5px 5px 5px;`;
